import React from "react";
import { Link } from 'react-router-dom';

function NavButtons(props){

    // const hrStyle = {
    //     height:"2px",
    //     borderWidth:"0",
    //     color:"gray",
    //     backgroundColor:"gray"
    // }
    return (
        <div className="row product-list-group">
         <div className="col-10"><span className="product-list-span">{props.name}</span></div>
         <div className="col-2 ">

         <Link to={props.linkName}>
            <button  type="button" className="btn btn-outline-dark">{props.btnName1}</button>
         </Link>

            <button id={props.btn2-id}  type="button" className="btn btn-outline-dark ml-3">{props.btnName2}</button>
         </div>
         id="delete-product-btn"
         {/* <hr style={hrStyle}/> */}
        </div>
    )
}


export default NavButtons;
